                  </div>
                </div>
              </div>
              <div
                style={{
                  width: "500px",
                  height: "auto",
                  border: "1px solid #adadad",
                }}
              >
                <div
                  style={{
                    width: "100%",
                    display: "inline-flex",
                    padding: "20px",
                  }}
                >
                  <div style={{ margin: "auto", fontWeight: "bold" }}>
                    DERGUESI
                  </div>
                  <div style={{ margin: "auto", fontWeight: "bold" }}>
                    MARRESI
                  </div>
                </div>
              </div>
              <div
                style={{
                  width: "500px",
                  height: "auto",
                  border: "1px solid #adadad",
                }}
              >
                <div
                  style={{
                    width: "100%",
                    display: "inline-flex",
                    padding: "20px",
                  }}
                >
                  <div style={{ margin: "auto", fontWeight: "bold" }}>
                    <span style={{ color: "#717171" }}>SUBJEKTI </span>
                    <p>
                      {ticket?.users?.firstName} {ticket?.users?.lastName}
                    </p>
                  </div>
                  <div style={{ margin: "auto", fontWeight: "bold" }}>
                    <span style={{ color: "#717171" }}>SUBJEKTI </span>
                    <p>
                      {ticket?.firstName} {ticket?.lastName}
