              >
                <div
                  style={{
                    width: "100%",
                    display: "inline-flex",
                    padding: "10px",
                  }}
                >
                  <div style={{ margin: "auto", fontWeight: "bold" }}>
                    <span style={{ color: "#717171" }}>KOD REFERENCE </span>
                    <p>#</p>
                  </div>
                  <div style={{ margin: "auto", fontWeight: "bold" }}>
                    <span style={{ color: "#717171" }}>NR.FAT.TATIMORE </span>
                    <p>#</p>
                  </div>
                </div>
              </div>
              <div
